import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

import AddressCard from '../Card/Card';
import './Search.css';

const AddressSearch = () => {
  const [address, setAddress] = useState([])

  useEffect(() => {
    axios.get('http://localhost:5000/address')
    .then((response) => {
      setAddress(response.data);
      console.log(response.data);
    });
  }, []);

  return (
    <div className='address-search'>
      <header className='address-search__header'>
        <h1>Endereços</h1>
        <Link to="/create">Novo endereço</Link>
      </header>

      <input className='address-search__input' type='search' placeholder="Buscar"/>

      {address.map((address) => (
          <AddressCard address={address} key={address.cep}/>  
      ))}
    </div>
  )
}

export default AddressSearch;
